  state = { rollResult: diceRollResults };

  render() {
    const defaultRoll = {
      D4: [],
      D6: [],
      D8: [],
      D12: [],
      D20: [],
    };

    const clear = () => {
      console.log("Clear Button Clicked");
    };

    return (
      <button
        onClick={() => {
          clear();
        }}
      >
        I am clear button
      </button>
    );
  }
}

export default ClearButton;
